import React, {useEffect, useState} from 'react';
import {completeddocument} from '../data/completeddocument';

const DocumentCompleted = () => {
    const [fields, setFields] = useState([])
    useEffect(() => {
        setFields(completeddocument)
    }, [])
   const field = fields.map((el) => (
        <div>
            {el}
        </div>
    ))
    return (
        <div className="container">
            <div className="document__completed">
                <p> Time</p>
                <p> Node Name </p>
                <p> Operator </p>
                <p> Operation</p>
                <p> Process Opinion </p>
                <div className="document__completed-column">
                    {
                        field.time
                    }
                </div>
                <div className="document__completed-column">
                    {
                        fields.map((el) => (
                            <div>
                                {el.operator}
                            </div>
                        ))
                    }
                </div>
                <div className="document__completed-column">
                    {
                        fields.map((el) => (
                            <div>
                                {el.operation}
                            </div>
                        ))
                    }
                </div>
                <div className="document__completed-column">
                    {
                        fields.map((el) => (
                            <div>
                                {el.operation}
                            </div>
                        ))
                    }
                </div>
                <div className="document__completed-column">
                    {
                        fields.map((el) => (
                            <div className="document__completed-col">
                                <span>
                                {el.process.process}
                                </span>
                                <span>
                                {el.process.time}
                        </span>
                            </div>
                        ))
                    }
                </div>
            </div>


        </div>
    );
};

export default DocumentCompleted;
